import numpy as np
import matplotlib.pyplot as plt
import pycocotools.mask as coco_mask

def encode_mask(mask):
    rle = coco_mask.encode(np.asfortranarray(mask.astype(np.uint8)))
    rle_dict = {
        'counts': rle['counts'].decode('utf-8'),
        'size': rle['size']
    }
    return rle_dict


def decode_mask(encoded_mask):
    rle = {
        'counts': encoded_mask['counts'].encode('utf-8'),
        'size': encoded_mask['size']
    }
    mask = coco_mask.decode(rle).astype(bool)
    return mask

def draw_segmentation(image, mask, bbox, point):
    fig, ax = plt.subplots(1)
    ax.imshow(image)

    # 在图像上绘制掩码
    ax.imshow(mask, alpha=0.5)

    # 绘制边界框
    rect = plt.Rectangle((bbox[0], bbox[1]), bbox[2], bbox[3],
                         linewidth=2, edgecolor='r', facecolor='none')
    ax.add_patch(rect)

    # 标记中心点
    ax.plot(point[0], point[1], 'yo')

    plt.show()

