# 初始化一个全零掩码，用于合并所有掩码
height, width = data[0]['segmentation']['size']
combined_mask = np.zeros((height, width), dtype=np.uint8)
# 创建绘图
fig, ax = plt.subplots(1)
ax.imshow(combined_mask, cmap='gray')  # 显示底图

# 循环处理每个掩码并绘制其边界框和中心点
for mask_data in data:
    binary_mask = decode_mask(mask_data['segmentation'])
    combined_mask = np.maximum(combined_mask, binary_mask)  # 合并掩码

    # 绘制边界框
    bbox = mask_data["bbox"]
    rect = plt.Rectangle((bbox[0], bbox[1]), bbox[2], bbox[3],
                         linewidth=2, edgecolor='r', facecolor='none')
    ax.add_patch(rect)

    # 标记中心点
    point = mask_data["point_coords"][0]  # 假设中心点是列表中的第一个元素
    ax.plot(point[0], point[1], 'yo')

# 显示最终的组合图像
plt.show()
